const List = ({recipes,setRecipes}) => {

  return (
    <ul>
      {recipes.map((plate) => {
        return (
             <ListItem recipe={plate} key={plate.id} setRecipes={setRecipes}/>
        )
      })

      }
    </ul>
  )
}

export default List
